package com.qa.iterations;

public class Exercise5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		printNumbers();
	}

	public static void printNumbers() {
		for (int A = 1; A <= 10; A++) {
			for (int i = 1; i <= A; i++) {
				System.out.println(A);
			}
		}
	}

}
